<style lang="scss">
    @import '../_config.scss';

    .article-lay{
        z-index: 100 !important ;
        background: var(--bg-we);
        position: fixed;
        top: 0;
        left: 0;    
        width: 100%;
        min-height: 100vh;

        .art{
            .pleload{
                .pr{
                    article{
                        .login{
                            position: relative;
                            margin:auto; 
                            display: grid;
                            grid-template-rows:3fr 1fr 1fr;

                            //top section 

                            .top-sect{  
                                display: flex;
                                align-items: center;
                                justify-content: center;
                            
                                .ts{
                                    
                                    .logo{
                                        .svg-logo{
                                            display: flex;
                                            justify-content: center;
                                            svg{
                                                width: 200px;
                                                margin: 10px;
                                            }
                                        }
                                    }
                                    .text{
                                        text-align: center;
                                        h1{
                                            @include font(var(--tc),1.1rem,700);
                                            margin: 10px;
                                            padding:10px;
                                            letter-spacing: 5px;
                                        }
                                        p{
                                            @include font(var(--d-bl),12px,500);
                                            text-transform: uppercase;
                                            
                                        }
                                    }
                                }
                            }

                            // middle section
                            .mid-sect{
                                .ms{
                                    text-align: center;
                                }
                            }
                            

                          

                            // foot section
                            .foot-sect{                        
                                display: flex;
                                align-items: center;
                                justify-content: center;
                                .fs{
                                    width:100%;
                                    padding: 10px;
                                    text-align: center;
                                    a{
                                    
                                        display: block;
                                        text-decoration: none;
                                        width:100%;
                                        @include font(var(--tc),1rem,800);
                                        
                                        padding: 10px 20px;
                                    }
                                }
                            }



                        }
                        // animation 

                        .squares{
                            position: fixed;
                            z-index: 5;
                            top:0;
                            left:0;
                            width:100%;
                            height: 100vh;
                            display: flex;
                            align-items: center;
                            justify-content: center;
                        
                            .square{
                                border-radius: 5px;
                                display:inline-block;
                                
                                margin:10px;
                                position:relative;
                                box-shadow:0 0 20px rgba(0, 0, 0, 0.07);
                                @include font(var(--tc), 0.2rem, 500);
                                font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;
                                animation:bouncer cubic-bezier(.455,.03,.515,.955) .75s infinite alternate;
                                padding: 7px 8px;
                            }
                            .square:nth-child(5n+1){
                             
                                animation-delay:0
                            }
                            .square:nth-child(5n+2){                                
                             
                                animation-delay:calc(0s + (.1s * 2))
                            }
                            .square:nth-child(5n+3){
                               
                                animation-delay:calc(0s + (.1s * 6))
                            }
                            .square:nth-child(5n+4){
                                animation-delay:calc(0s + (.1s * 8))
                            }
                        }
                    }
                }
            }
        }

        

    }
    @keyframes bouncer{

        to{
                box-shadow:0 0 20px rgba(0,0,0,.3);
                transform:scale(1.55) translateY(-20px);
                font-size: 0.9rem;
                
                
            }
    }


  
</style>














